import React from "react";
import "./Header.css";
import ShoppingBasketIcon from "@mui/icons-material/ShoppingBasket";

const Header = () => {
  return (
    <>
      <div className="mainHeader">
        <div>
          <h1>React Meals</h1>
        </div>

        <div className="cart">
          <div className="icons">
            <ShoppingBasketIcon />
          </div>
          <div className="">
            <p>Your Cart</p>
          </div>
          <div className="cart_num">
            <p>0</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Header;
